import { useEffect, useState } from "react";

function AuthorChannelVideos({ userInfo, authorinfo, authorslug }){
    const [isLoading, setIsLoading] = useState(true);


    useEffect(() => {
        fetch('http://localhost:8000/api')
        .then(response => {
            return response
        })
        .then(res => {
            setIsLoading(false);
            console.log(res);
        })
    }, [])
    return (
        <>
            {authorinfo.channelname}
        </>
    )
}
export default AuthorChannelVideos;
